    # Approach: Bottom-Up Dynamic Programming (Space-Optimized)
    # Time: O(n)
    # Space: O(1)
    def distinctSubseqII(self, s: str) -> int:
        MOD = int(1e9+7)
        n = len(s)
        dp = 1
        last = [0] * 26
        for idx in range(n):
            key = ord(s[idx]) - ord('a')
            last[key], dp = dp, (dp * 2 - last[key] + MOD) % MOD
        # -1, excluding the empty subsequence
        return (dp - 1 + MOD) % MOD

